import logo from './logo.svg';
import './App.css';
import React from 'react';
import {ToastContainer} from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

function App() {
  return (
    <div className="App">
        <ToastContainer postion = "top-center"/>
        <h2>Hello React</h2>
    </div>
  );
}

export default App;
